(6, '5 Rekomendasi Wisata Alam di Kalimantan Selatan', '1677294716_Blog-feature-1.png', '<p>Indonesia merupakan salah satu negara dengan keanekaragaman&nbsp;wisata alam yang sangat menakjubkan. Semua wilayah di Indonesia setidaknya punya satu wisata alam di daerahnya, begitu juga&nbsp;di&nbsp;salah satu provinsi di Kalimantan yaitu&nbsp;Kalimantan Selatan yang tak kalah menakjubkannya dengan wisata alam lain yang terkenal. Nah, kebetulan sekali libur sekolah telah tiba, biasanya siswa saat liburan sekolah pasti ingin melakukan rekreasi ke berbagai tempat wisata dengan tujuan melepas penat selama sekolah.</p>\r\n\r\n<p>Nah, disini telah&nbsp;dirangkum 5 tempat rekreasi libur sekolah yang cocok untuk para siswa melepas penatnya&nbsp;di Kalimantan Selatan. Mau tahu apa saja? Ayo baca sampai habis ya.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>1. Matang Kaladan</p>\r\n\r\n<p><img src=\"data:image/jpeg;base64,\" style=\"height:100%; width:100%\" /></p>\r\n\r\n<p>Anak gunung tentu tau nih objek wisata yang satu ini. Tempat yang menyajikan keindahan pemandangan yang membuat mata tak berkedip tentu ada di Matang Kaladan.</p>\r\n\r\n<p>Matang Kaladan adalah objek wisata yang berada di Desa Tiwingan Lama, Kecamatan Aranio. Di sini waisatawan disuguhi pemandangan alam yang luar bisa indah layaknya Raja Ampat yang terdapat pulau-pulau kecil. Berhubung lokasi wisata ada di puncak wisatawan dapat menggunakan jasa ojek mulai dari Rp15.000 sampai Rp20.000.</p>\r\n\r\n<p>Di tempat ini, wisatawan biasanya memulai perjalanan dari dermaga Desa Tiwingan Lama untuk memulai tantangan mendaki tebing curam dengan menapaki ribuan anak tangga setinggi 400 meter, warga sekitar menyebutkan tempat ini adalah perjalanan cinta 1000 anak tangga. Selama mendaki tidak usah takut akan kelelahannya, karena di setiap dakian terlihat berbagai pemandangan yang menyejukkan hati sehingga ingin mendaki sampai ke puncak anak tangga.</p>\r\n\r\n<ul>\r\n	<li>Buka mulai jam 6 pagi sampai jam 6 sore waktu setempat.</li>\r\n	<li>Harga tiket masuk Rp5.000</li>\r\n</ul>\r\n\r\n<p>2. Pulau Kembang</p>\r\n\r\n<p><img src=\"data:image/jpeg;base64,\" style=\"height:100%; width:100%\" /></p>\r\n\r\n<p>Dari asal katanya saja sudah terlihat jelas ya &ldquo;Kembang&rdquo; yang mana ketika mendengar kata kembang yang bertama kali terbayang di pikiran kita adalah pulau yang memiliki banyak bunga yang mekar. Tapi bener gak sih ya kalau Pulau Kembang ini dipenuhi oleh bunga yang bermekaran ? Sayang sekali, bukan bunga yang terlihat tapi berbagai macam kera yang memenuhi tempat ini, gimana menakjubkan bukan.</p>\r\n\r\n<p>Pulau Kembang berada di Desa Alalak, Kabupaten Barito Kuala. Saat di Pulau Kembang wisatawan akan berjumpa dengan monyet, ada yang baik dan ada juga yang usil. Untuk dapat sampai ke Pulau Kembang perlu perjalanan menggunakan perahu. Tetapi itu sangat menyenangkan ditambah udara sejuk, pepohonan yang rimbun, dan suara kicauan burung membuat kita serasa hidup di dunia fantasi.</p>\r\n\r\n<ul>\r\n	<li>Buka mulai jam 7 pagi sampai jam 5 sore waktu setempat</li>\r\n	<li>Harga tiket masuk mulai Rp5.000 sampai Rp8.000</li>\r\n</ul>\r\n\r\n<p>3. Taman Hutan Raya Sultan Adam</p>\r\n\r\n<p><img src=\"data:image/jpeg;base64,\" style=\"height:100%; width:100%\" /></p>\r\n\r\n<p>Taman yang gak kalah keren ni teman-teman tentunya di taman hutam Raya Sultan Adam. Taman ini berlokasi di Desa Mandiangin, Kabupaten Banjar. Di sini kita dapat menikmati udara yang sejuk dan berbagai macam spot foto cocok bagi kalian yang suka berburu foto dengan latar belakang peggunungan Meratus, flora fauna Kalimantan, dan air terjun. Bagi kalian yang ingin bermalam di sekitar daerah ini ada juga penginapannya.</p>\r\n\r\n<p>Bagi anak hutan pasti tidak ingin ketinggalan melewati objek wisata yang satu ini. Taman yang berada di area hutan dan perbukitan merupakan kesenangan bagi kaum pengelana yang sering bepergian ke daerah perbukitan. Tidak hanya itu, taman ini juga menunjang berbagai kegiatan belajar dan ekosistem seperti edukasi, penelitian, sosial dan budaya.</p>\r\n\r\n<ul>\r\n	<li>Harga tiket masuk perorangan untuk anak-anak Rp8.000 dan dewasa Rp10.000</li>\r\n	<li>Harga tiket masuk untuk motor Rp10.000 dan mobil Rp25.000</li>\r\n</ul>\r\n\r\n<p>4. Pantai Tabanio</p>\r\n\r\n<p><img src=\"data:image/jpeg;base64,\" style=\"height:100%; width:100%\" /></p>\r\n\r\n<p>Saat musim panas datang, tentu pantai menjadi salah satu sasaran para wisatawan yang pergi ke suatu wilayah, nah jika anda sedang berada di Kalimantan Selatan jangan lupa untuk berkunjung ke pantai yang berada di&nbsp;daerah pesisir&nbsp;yaitu&nbsp;pantai Tabanio. Pantai ini terletak di Kabupaten Tanah Laut, Kalimantan Selatan. Pantai yang buka 24 jam ini cocok untuk dikunjungi waktu sore dan juga tiket harga masuknya terjangkau. Kalian akan disuguhi indahnya sunset yang cocok bagi kalian para pencipta puisi yang memerlukan ide baru.</p>\r\n\r\n<p>Berbagai daya tarik dimiliki oleh pantai ini yang membuat anda tidak ingin meninggalkannya. Diantaranya adalah Pesona keindahannya yang menyejukkan hati, memiliki biota laut yang mudah ditemukan, bahkan pantai ini memiliki sebuah benteng peninggalan penjajah Indonesia.</p>\r\n\r\n<ul>\r\n	<li>Banyak pedagang camilan di sekitar pesisir pantai, jadi tak perlu takut kelaparan setelah bermain di pantai.</li>\r\n	<li>Harga tiket masuk Rp10.000 perkepala.</li>\r\n</ul>\r\n\r\n<p>5. Pantai Takisung</p>\r\n\r\n<p><img src=\"data:image/jpeg;base64,\" style=\"height:100%; width:100%\" /></p>\r\n\r\n<p>Tidak kalah dengan pantai Tabanio, satu lagi pantai yang menarik banyak wisatawan adalah pantai Takisung yang berlokasi di Desa Takisung, Kabupaten Tanah Laut yang berjarak lebih kurang 22 kilometer dari Kota Pelaihari. Pantai Takisung buka 24 jam dan harga untuk tiket masuknya murah mulai dari Rp5.000. Selain kita dapat menikmati keindahan sunset dan sunrise yang sangat cantik, terdapat juga permainan banana boat dan ATV yang membuat kita betah berlama-lama di sini. Menjadi daya tarik tersendiri juga pantai Takisung karena ada pasar yang menjual makanan khas daerah dan cindramata dari kerang atau keong laut.</p>\r\n\r\n<p>Sebagai tempat wisata, pantai ini memiliki keindahan yang tidak kalah menakjubkan dengan adanya aktivitas jual beli ikan segar langsung dari nelayan, pantai yang dikelilingi oleh pohon - pohon kelapa dengan pasirnya yang berwarna coklat seperti air lautnya. Selain itu, di pantai ini juga banyak penjual yang menjal hiasan kerang, udang, ikan sampat terumbu karang. Gimana menarik kan.</p>\r\n\r\n<ul>\r\n	<li>Masih terdapat banyak flora laut yang sering dijumpai misalnya ubur-ubur</li>\r\n	<li>Harga tiket masuk Rp5.000 untuk hari kerja dan Rp10.000 untuk weekend.</li>\r\n</ul>\r\n\r\n<p>Selain kelima tempat diatas, masih banyak lagi tempat wisata di Kalimantan Selatan. Apabila kamu memiliki kesempatan untuk mengunjungi berbagai objek tersebut apa salahnya dicoba sekedar menghilangkan penat dari kepala. Menghabiskan waktu untuk bersantai tidak harus dengan harga yang mahal tetapi bagaimana agar hati kita tentram di tempat tersebut.</p>\r\n\r\n<p>Nah, itulah 5 rekomendari wisata alam untuk berlibur di Kalimantan selatan. Bagaimana menurut kalian?. Selamat liburan sekolah ya.(Tata)</p>\r\n\r\n<p>&nbsp;</p>', 3, 'Tour', NULL, '2023-01-02 13:00:00', '2023-02-25 16:20:26');
INSERT INTO `articles` (`id_article`, `title`, `feature_image`, `content`, `view`, `category`, `deleted_at`, `created_at`, `updated_at`) VALUES
(10, '5 Tempat Wisata yang Wajib di Kunjungi Pada Hari Libur', '1677296601_Blog-feature-2.png', '<p>Banyak tempat wisata di Purwokerto yang populer serta dekat dengan alam. Destinasi yang berada pada bagian dasar lereng gunung Slamet ini, menyajikan berbagai wisata alam yang sejuk dengan pemandangan yang menakjubkan.</p>\r\n\r\n<p>Lalu, apa saja tempat wisata yang cocok untuk melepas penat di Purwokerto? Berikut 5 rekomendasi tempat wisata yang dapat kalian kunjungi jika ingin menghabiskan liburan di Purwokerto.</p>\r\n\r\n<p><strong><strong>1. Menara Pandang Teratai</strong></strong></p>\r\n\r\n<p><img style=\"height:100%; width:100%\"  src=\"data:image/png;base64,\" /></p>\r\n\r\n<p>Menara Pandang Teratai merupakan salah satu destinasi baru yang sangat populer di Purwokerto. Menara yang menjadi icon wisata Banyumnas ini memiliki tinggi kurang lebih 117 meter. Di dalam menara, terdapat sebuah lantai kaca di lantai paling atas sehingga pengunjung dapat melihat ke bawah melalui lantai tersebut. Tempat ini juga merepresentasi tempat wisata yang sinergi dan religius, di mana di dalamnya tersimpan 7 kitab suci&nbsp;yang merupakan kitab dari berbagai agama di Indonesia. Selain itu, di destinasi ini juga akan&nbsp;dibangun tempat&nbsp;ibadah&nbsp;dari&nbsp;6 agama.</p>\r\n\r\n<p>Alamat : Jalan Bung Karno, Sawangan, Kedungwuluh, Purwokerto Barat.</p>\r\n\r\n<p>Harga Tiket : Rp20.000</p>\r\n\r\n<p><strong><strong>2. Kebun Raya Batur</strong></strong><strong><strong>r</strong></strong><strong><strong>aden</strong></strong></p>\r\n\r\n<p><img style=\"height:100%; width:100%\"   src=\"data:image/png;base64,\" /></p>\r\n\r\n<p>Salah satu wisata alam yang sering di kunjungi di Purwokerto adalah Kebun Raya Baturraden. Di dalam kebun yang sangat menakjubkan ini, terdapat berbagai macam objek wisata seperti pemandian air panas, kolam renang, kolam luncur, terapi ikan&nbsp;dan banyak lagi. Jika pergi ke taman ini, kita tidak hanya disuguhkan banyaknya objek wisata tetapi juga bisa menikmati udara segar pegunungan dan pemandangan alam yang indah.</p>\r\n\r\n<p>Alamat : Jalan Pancurantujuh - Wanawisata Baturraden, Purwokerto, Dusun III Berubahan, Kemutug Lor, Kec. Baturaden, Kabupaten Banyumas.</p>\r\n\r\n<p>Harga Tiket : Rp14.000</p>\r\n\r\n<p><strong><strong>3. Pancuran Pitu</strong></strong></p>\r\n\r\n<p><img alt=\"\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/1/12/Pancuran_Tujuh%2C_near_Baturraden%2C_Purwokerto_2015-03-23_03.jpg/1200px-Pancuran_Tujuh%2C_near_Baturraden%2C_Purwokerto_2015-03-23_03.jpg\" style=\"height:100%; width:100%\" /></p>\r\n\r\n<p>Sesuai dengan asal namanya, Pancuran Pitu memiliki arti tujuh pancuran di kawasan sumber air panas alami yang memiliki air terjun dengan tujuh pancuran yang indah. Destinasi ini&nbsp;baik untuk relaksasi tubuh dan pikiran,&nbsp;dengan menikmati air terjun hangat dengan&nbsp;kandungan belerang yang tinggi. Selain cocok untuk relaksasi, air hangat yang ada di destinasi ini&nbsp;juga dipercaya sebagain&nbsp;media pengobatan,&nbsp;khususnya penyakit kulit.</p>\r\n\r\n<p>Alamat : Lokawisata Baturaden, Kalipagu, Ketenger, Kecamatan Baturaden, Kabupaten Banyumas, Jawa tengah.</p>\r\n\r\n<p>Harga Tiket : Rp10.000</p>\r\n\r\n<p><strong><strong>4. Bukit Tranggulasih</strong></strong><img alt=\"\" src=\"https://travelspromo.com/wp-content/uploads/2019/07/Bukit-tranggulasih-banyumas-pley-Art.jpg\" style=\"height:100%; width:100%\" />Tempat populer lainnya yang memiliki nuansa pemandangan alam yang indah adalah Bukit Trangulasih. Destinasi ini sangat cocok untuk melakukan kegiatan kemah pada malam perayaan. Selain itu, di bukit ini kamu bisa menikmati indahnya matahari terbenam dan matahari terbit, dan pada malam harinya&nbsp;kamu bisa melihat indahnya kelap-kelip lampu Kota Purwokerto dari atas bukit.</p>\r\n\r\n<p>Alamat : Dusun III, Windujaya, Kec. Kedungbanteng, Kabupaten Banyumas.</p>\r\n\r\n<p>Harga Tiket : Rp5.000</p>\r\n\r\n<p><strong><strong>5. The Village Purwokerto</strong></strong></p>\r\n\r\n<p><img alt=\"\" src=\"https://www.pinhome.id/info-area/wp-content/uploads/2022/03/The-Village-Baturaden-Purwokerto-Adien-Akhmad-1.jpg\" style=\"height:100%; width:100%\" /></p>\r\n\r\n<p>Wisata alam terakhir yang disarankan adalah The Village Purwokerto. Destinasi ini sangat terkenal akan properti dari bangunan hingga taman yang bergaya Eropa. Tidak hanya itu, di tempat ini pengunjung juga bisa menaiki perahu, memberi makan bidatang, menunggangi kuda hingga memakai kostum khas daeran Eropa.</p>\r\n\r\n<p>Alamat : Dusun I, Rempoah, Kecamatan Baturaden, Kabupaten Banyumas, Jawa Tengah</p>\r\n\r\n<p>Harga Tiket : Rp20.000</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Itulah 5 tempat wisata yang cocok kamu kunjungi saat liburan di daerah Purwokerto. Selain kelima tempat tersebut, masih banyak lagi destinasi alam yang tersebar di daerah ini. Apabila kamu memiliki kesempatan untuk mengunjungi berbagai objek tersebut apa salahnya dicoba sekedar menghilangkan penat dari kepala. Nah, sudah ada gambaran mau liburan kemana ? Ingat, liburan bukan soal gengsi tapi bagaimana kita nyaman dengan hal tersebut. Selamat berlibur dan menikmati waktu healing ya!</p>', 5, 'Tour', NULL, '2023-01-05 13:00:00', '2023-02-25 16:20:05');

